I'm trying to write a DNS server in golang that forwards all requests to 8.8.8.8 and 1.1.1.1, and stores in a map all the hostnames to the resolved ips.

I have the following code so far:

```
package main

import (
	"fmt"
	"log"
	"net"
	"sync"

	"github.com/miekg/dns"
)

var (
	hostnameToIPs = make(map[string][]net.IP)
	mutex         sync.Mutex
)

func main() {
	dns.HandleFunc(".", func(w dns.ResponseWriter, req *dns.Msg) {
		client := new(dns.Client)
		in, err := client.Exchange(req, "8.8.8.8:53")
		if err != nil {
			log.Fatal(err)
		}
		if in != nil {
			hostname := req.Question[0].Name
			ips := make([]net.IP, 0, len(in.Answer))
			for _, answer := range in.Answer {
				if a, ok := answer.(*dns.A); ok {
					ips = append(ips, a.A)
				}
			}
			mutex.Lock()
			hostnameToIPs[hostname] = ips
			mutex.Unlock()
			log.Printf("%s -> %v\n", hostname, ips)
		}
		w.WriteMsg(in)
	})

	log.Fatal(dns.ListenAndServe(":53", nil))
}
```

This code works, but it has a few issues:

1. It only forwards requests to 8.8.8.8, but I want to forward requests to both 8.8.8.8 and 1.1.1.1.
2. It doesn't handle errors when exchanging the request with the upstream DNS servers.
3. It doesn't handle the case where the upstream DNS servers return an error.

How can I modify this code to fix these issues?

## Answer (1)

You can use the `dns.Client` to send requests to multiple upstream servers. You can use the `dns.Client.Exchange` method to send a request to an upstream server and wait for a response. If the upstream server returns an error, you can handle it and try sending the request to the next upstream server.

Here's an updated version of your code that fixes
